            "id": "event_14",
            "properties": {
                "name": "DH Long View Seminar Series: Mark Algee-Hewitt on \"Laboratory Life in the Humanities: Computation, Criticism, and Collaboration\" | Center for Spatial and Textual Analysis",
                "date": "Tue June 22nd 2021, 12:00pm",
                "location": "Online via Zoom",
                "description": "The Digital Humanities have profoundly altered the way that humanities scholars work, research, and teach. While the introduction of computational methods, from GIS, to Digital Archives, to Text Mining, have opened up new fields to practitioners, these fields have also changed the social fabric of the humanities. Although the myth of the lone scholar, toiling away in their office, or in the archives, remains deeply embedded in the psyche of the discipline, the growing influence of the Digital Humanities has begun to offer scholars other opportunities for research work and teaching.",
                "url": "https://cesta.stanford.edu/events/dh-long-view-seminar-series-mark-algee-hewitt-laboratory-life-humanities-computation",
                "year": "2021"
            },
            "value": 0
