                "date": "Tue May 18th 2021, 12:00pm",
                "location": "Online via Zoom",
                "description": "This collaboration combines methods from computational text analysis, literary studies, and clinical psychology to examine the therapeutic encounter as it manifests in a variety of texts. In particular, we compare a set of transcribed contemporary psychotherapy sessions to other forms of discourse including 20th- and 21st-century novels and memoirs, podcast interviews, and informal recorded conversation.",
