            "id": "event_24",
            "properties": {
                "name": "Mark Algee-Hewett: Distributed Character: Quantitative Models of the English Stage, 1500-1920 | Center for Spatial and Textual Analysis",
                "date": "Tue November 1st 2016, 12:00 - 1:15pm",
                "location": "Wallenberg Hall, Room 433A",
                "description": "If creating a network out of the social relationships within a play can tell us something new about the structure of the social world it represents, what can the networks of 3900 plays tell us? How does the morphology of the social networks represented on stage represent (or resist) both the politics and aesthetics of a period and, more importantly, how do these social network evolve over time? In this project, I move beyond the network analysis of a single play by examining the network structure of a large corpus of 3900 English dramas written and performed between 1500 and 1920.",
                "url": "https://cesta.stanford.edu/events/mark-algee-hewett-distributed-character-quantitative-models-english-stage-1500-1920",
                "year": "2016"
            },
            "value": 0
