                "location": "Wallenberg 433A",
                "description": "What are the unique challenges that face the humanities as we ground data-driven insights in real-world human complexity, and in various social, cultural, and historical contexts? Digitization and computational methods provide new opportunities for understanding the cultural implications of data, its meaning, and its significance to the long history of recorded human experience. We must therefore carefully consider the ways that we derive meaning from data through critical attention to methods and sources\u2014our critical data practices.",
