                "description": "With our most powerful optimizing engines today fueled on information from the past, it is more important than ever to know the provenance of that information and to understand its context. To keep pace with the needs of this information hungry age, we need to take care to maintain a thriving ecosystem of data management so that we don\u2019t find ourselves drowning in a swamp of undifferentiated data.\u00a0Libraries are not merely repositories, they are complex organizations that, in helping us manage information, knowledge, and cultural heritage, also help us manage bias.",
