                "date": "Tue May 23rd 2017, 12:00 - 1:30pm",
                "location": "Bldg. 160, Rm. 433A",
                "description": "What are the best ways of engaging with South Africa\u2019s pasts? It is necessary to ask this question in an abstract and general way, as I make the transition from one very focused project (an edited book) to a broader project or projects. Material from South Africa, Greece, Rome: Classical Confrontations is in the process of becoming the core of a digital museum with the same name. While this project is framed by a specific question \u2013 How have ancient Greece and Rome intersected with South African pasts?",
