                "description": "A panel of digital medievalists takes stock of several significant leaps forward in digital medieval studies this year, most notably the first DH-focused issue from the field\u2019s premier journal, Speculum, and the launch of a Digital Humanities and Multimedia Studies Prize by the Medieval Academy of America. At this pivotal moment in digital medieval studies, the panel assesses progress, boundaries, and setbacks, with particular attention to the field\u2019s self-identified exceptionalism, potentials for collaboration, and the effects of mainstreaming.",
