                "date": "Tue January 24th 2023, 12:00 - 1:15pm",
                "location": "Wallenberg 433A",
                "description": "The past has never seemed to be so close: it is just a click away. Recent years have brought a proliferation of data, be it manuscript images, digitised secondary literature or archaeological sources. This is an unprecedented prospect. The accessibility of this data is a promise and an opportunity. It can explode old narratives, allow marginalised communities access to their pasts, make us discover new meaningful explanations. At the same time this proliferation brings with it enormous challenges.",
                "url": "https://cesta.stanford.edu/events/mateusz-fafinski-past-not-just-graph-doing-digital-history-today",
