                "date": "Tue November 1st 2022, 12:00 - 1:15pm",
                "location": "Wallenberg 443A",
                "description": "There are now many millions of high-resolution images of medieval manuscripts on-line. This is a huge step forward for public accessibility, but presents us with the challenge of what we might we do with this material beyond browsing with the \u201cTurning the Pages\u201d\u00a0and IIIF viewers provided by repositories. How might, for instance, letter-forms or iconographic motifs be catalogued, curated and compared to support evidence-based\u00a0scholarship? How fine-grained should our descriptions be?",
