                "date": "Tue January 25th 2022, 12:00 - 1:15pm",
                "location": "Online via Zoom",
                "description": "About this talk: Equal access to digital tools and media can only be ensured if they are created with accessibility in mind. Too often, accessibility can seem like a burden and be left to the final moments, if not neglected entirely. This talk will show that thinking about data and digital publication from the outset leads not only to better experiences for disabled users, but also to deeper, more fully developed, and more flexible projects overall.",
