                "date": "Tue October 5th 2021, 12:00 - 1:15pm",
                "location": "Zoom",
                "description": "The Hebrew Bible has always taken many forms. Prior to the rise of printing, hand-copied manuscripts varied dramatically from the care and expense used in their materials to textual details large and small. In some key ways, the population of medieval Psalms manuscripts is defined more by variation than uniformity, challenging simplistic and essentialist conceptions and representations of the text.",
                "url": "https://cesta.stanford.edu/events/eric-harvey-variance-population-thinking-text-concepts-use-data-conceptualizing-hebrew",
