                "description": "About this talk:\u00a0Manuscripts and other cultural heritage materials have always been depicted in different ways to increase access and for analysis. The digital repository is one of a long line of representational frameworks, including printed woodcuts, painted facsimiles, black and white photographs and analog color images. Every format has its own strategies for truthfulness of representation and for signaling interpretive norms. This talk stems from work undertaken on the Medieval Fragments Study Collection at Stanford University Libraries.",
