                "date": "Tue April 17th 2018, 12:00 - 1:20pm",
                "location": "Bldg. 160, Rm. 433A",
                "description": "What does it mean to create a universal knowledge of nature in an increasingly global age? This paper considers how naturalists aspired to study global nature from 1500 to 1900. During this period, Europeans sought to write a global natural history that categorized the plants and animals they encountered into one unified system of collection and classification. Non-Europeans, such as Ottomans and Mexica, however, had different stories to tell about their own quest in nature.",
