                "date": "Tue April 13th 2021, 12:00pm",
                "location": "Online via Zoom",
                "description": "International, interdisciplinary spaces are inevitably sites of tension, where differences in linguistic and cultural norms run deeper than they initially appear. Establishing and maintaining a set of norms for a community to operate despite these differences requires ongoing dialogue within that community. This talk will reflect on language as one longstanding axis of diversity within digital humanities as it is carried out at the international level, as well as within different national contexts.",
