                "date": "Tue October 20th 2020, 12:00pm",
                "location": "Broadcast live via Zoom.",
                "description": "When Stanford University\u2019s spring quarter moved online, I had to revise my annual collections-based curation course from physical exhibition to virtual\u2014in this case, of models of famous Mesoamerican artifacts. We were in the best position ever for this change, in large part because we had been working with CESTA since winter planning a digital map to supplement our physical exhibit. But it was no simple \u201cpivot\u201d moving student curation online. It demanded a wholesale redesign of course content and project goals.",
