                "location": NaN,
                "description": "The talk will introduce the current Stanford University Archaeology Collections (SUAC) exhibit Our Dark Materials: Rediscovering an Egyptian Collection (ODM) and, through it, consider the potential of digital humanities to extend and enhance the impact of in-real-life museum displays. By affording personal encounters with authentic artifacts, traditional exhibits like ODM offer an experience that cannot be digitally duplicated. But exhibits like this one are simultaneously constrained by their materiality.",
