                "location": "Zoom Webinar: https://stanford.zoom.us/webinar/93280857767",
                "description": "Between 1864 and 1869, thousands of Chinese migrants toiled at a grueling pace and in perilous working conditions to help construct America\u2019s first Transcontinental Railroad. The labor of these Chinese workers (who eventually numbered between 10-12,000 at any one moment) was central to creating the wealth that Leland Stanford used to found Stanford University. But these workers have never received the attention they deserve. We know relatively little about their lives. What led them to come to the United States? What experiences did they have in their arduous work?",
