                "location": "Wallenberg Hall, Room 433A",
                "description": "Historically, catastrophes and disaster occasioned early efforts at social data collection. With these data before them, early modern authorities considered how best to respond to disaster and ward off recurrence. Meanwhile, modern catastrophes have inspired examinations of premodern data with an eye to understanding the deep patterns of the longue dur\u00e9e, with hopes of yielding not only a better understanding of the past, but also actionable data relevant to our contemporary crises.\u00a0",
