                "date": "Tue October 6th 2020, 12:00pm",
                "location": "Broadcast live via Zoom.",
                "description": "Dr. Hanjo Hamann introduces the concept of \"distant reading\" into the German legal discourse. He uses a unique corpus of sample solutions for bar exams administered in Germany since 2007 to explore what they might tell us about the knowledge required of German lawyers. By trying out various descriptive statistics, co-occurence analysis and text vectorisation, Dr. Hamann hopes to shine a light into the black box of legal education in Germany.",
