                "description": "Digitizing the Grand Tour II: a workshop on the worlds and lives of eighteenth-century travelers to Italy Organized by Prof. Giovanna Ceserani - Stanford's Classics Department \u00a0 We are bringing to Stanford leading scholars of Grand Tour studies and eighteenth-century cultural history for two days of reflections on eighteenth-century\u00a0travel to Italy and digital approaches to its\u00a0study.",
