                "date": "Tue May 9th 2017, 12:00 - 1:30pm",
                "location": "Bldg. 160, Rm. 433A",
                "description": "What are the literary and linguistic foundations of our understanding of race? This project maps the frequency and semantic associations of racial and ethnic terms across approximately 18,000 U.S. novels in order to construct a detailed historical picture of the American racial imaginary. By identifying significant collocates of key racial and ethnic terms at particular historical moments, we are able to reconstruct the semantic system that gave racial concepts narrative meaning.",
