                "description": "The Cairo Geniza is one of the largest and most coherent caches of fragmentary manuscripts ever discovered: 400,000 items discarded by the Egyptian Jewish community over a period of 900 years. Digitization efforts began at Princeton as early as 1985, with Penn, Cambridge and a privately funded foundation entering the fray over the decades. The geniza is an excellent case-study in what digitization can and cannot accomplish.",
