                "date": "Thu April 23rd 2020, 10:00 - 11:00am",
                "location": "Zoom Webinar",
                "description": "Today, more than 30,000 fragments of medieval manuscripts can be found in hundreds of North American collections, and yet such fragments are often dismissed by scholars as unworthy of study and by librarians as too difficult to catalogue. On the contrary. Fragments represent a largely-untapped source of research topics and teaching opportunities, but they must be found, imaged, and catalogued before they can be used for investigation and pedagogy.",
