                "description": "Does your research depend on understanding trends in popular culture, or require data on current events? You might be interested in analyzing social media data, such as collections of tweets. In this workshop, we'll discuss several options for finding social media data, and discuss legal and ethical issues surrounding obtaining such data. We'll also look at several examples of how you can use social media data, such as text mining large collections of tweets.\u00a0\u00a0",
