                "date": "Tue May 24th 2022, 12:00 - 1:15pm",
                "location": "Hybrid event: in-person at CESTA and via Zoom",
                "description": "About this talk: Scholars and students at early modern European universities wrote hundreds of thousands of dissertations. One reason why these sources have often been neglected is that they defy any individual\u2019s capacity for close reading. This talk presents a distant reading of the titles of over 20,000 legal dissertations written at German universities during the seventeenth century.",
                "url": "https://cesta.stanford.edu/events/luca-scholz-distant-reading-law-dissertations",
                "year": "2022"
