                "location": "Bldg. 160, 4th Floor",
                "description": "In this presentation, two scholars will present exciting new spatial approaches to understanding changing institutional and home landscapes across Asia. Their work uses spatial data to examine two empirical puzzles - China\u2019s unexpected transition from a country without commercial banks to the world\u2019s largest banking market in only three decades, and the large urban-rural gap in household sanitation across India. In this talk, Adam Liu will use spatial data of Chinese banks to examine the firm-level consequences of banking market competition in an authoritarian state.",
