                "location": "Bldg. 160, Rm. 433A",
                "description": "Born as a digital companion to her PhD project devoted to the spatial history of advertising in modern Shanghai (1905\u20131949),\u00a0MADSpace\u00a0(http://madspace.org/) has gradually become an integrated platform and a multi-actorial database. As this project\u2019s primary goal is to shift the gaze from cultural studies to a spatial and social history of advertising, it is based on a wide range of primary sources (municipal and business archives, personal papers, press advertisements, professional handbooks, original sketches street photos and videos).",
