                "date": "Tue November 7th 2017, 12:00 - 1:15pm",
                "location": "Bldg. 160, Rm. 433A",
                "description": "Recent scholarship has begun to address limitations and even potential methodological flaws in high-profile distant reading projects. Katherine Bode argues that, rather than opposed, close and distant reading are in many ways equivalent. As an antidote, she calls for the creation of scholarly editions of data that model the literary system under examination. In a similar vein, Richard Jean So argues that many distant reading projects describe rather than model their corpus, thereby missing out on the possibilities for more nuanced analysis.",
