                "date": "Thu April 27th 2017, 12:30 - 2:00am",
                "location": "Bldg. 160, Rm. 433A",
                "description": "During the second half of the 19th century, the stock exchange in Frankfurt on the Main in central Germany emerged as a premier hub for European capital export to the Americas. In hindsight, Frankfurt\u2019s continued importance vis-\u00e0-vis far larger stock exchanges in Berlin, London, Paris, or Vienna can seem somewhat puzzling. What enabled this small, mercantile center to hold its own amidst fierce competition from Europe\u2019s giant metropolises?",
