                "date": "Tue April 18th 2017, 12:00 - 1:30pm",
                "location": "Bldg. 160, Rm. 433A",
                "description": "In the 18th and and 19th centuries, the Ottoman Empire, from the Greece to Crimea, from Anatolia to Egypt, (including tens of islands in the Mediterranean), was divided into regional orders under the leadership of various provincial dynasties. These dynasties established fiscal and administrative contactual relations with the Empire, built diverse mechanisms for agricultural economy, taxation, trade, transportation and communication, and initiated architectural and technological infrastructure with natural resources and local expertise. \u00a0\u00a0",
                "url": "https://cesta.stanford.edu/events/cesta-seminar-ali-yaycioglu-antonis-hadjikyriacou-mapping-ottoman-greece-space-power-and",
