                "location": "Bldg. 160, Rm. 433A",
                "description": "The Tremulator is a digital tool developed initially to aid in the collection and visualization of \u2018irregular\u2019 data found in medieval manuscripts, especially the interventions and signs of use left behind by medieval and post-medieval readers of those manuscripts. It takes its name from the first subject whose signs of use it has been employed to collect and annotate: the so-called Tremulous Hand of Worcester, a thirteenth-century scribe who marked up nearly two dozen Old English manuscripts.This tool was developed, then, for a very specific purpose, yet Prof.",
