                "date": "Tue February 28th 2017, 12:00 - 1:30pm",
                "location": "Bldg. 160, Rm. 433A",
                "description": "When applied to arts associated with West Africa, the Senufo label identifies a style and facilitates classification of objects for sale or study when little or no documentation exists about specific artists, patrons, or audiences. Early twentieth-century connoisseurs and scholars who first looked at objects from the African continent as art sought to delineate such discrete styles. The approach is grounded in an assumption that art style coincides with language, religion, social organization, and geography.",
