                "date": "Tue May 16th 2023, 12:00 - 1:15pm",
                "location": "Wallenberg 433A",
                "description": "In medieval churches, liturgical monumental installations were fundamental for both the setting and practice of the sacred. Where they have been dismantled, destroyed, or heavily transformed, the understanding of a medieval sacred space is possible only through reconstructive projects that require multidisciplinary research and collaborative endeavors.",
                "url": "https://cesta.stanford.edu/events/elisabetta-scirocco-mapping-sacred-spaces-medieval-southern-italy",
