            "id": "event_270",
            "properties": {
                "name": "David Sebastiani: Plotting the Unknown: Reading Networks in the Early Modern Mediterranean | Center for Spatial and Textual Analysis",
                "date": "Tue April 11th 2023, 12:00 - 1:15pm",
                "location": "Wallenberg 433A",
                "description": "The Mediterranean has always been a place of trade and migration. Early modern diasporas imparted further impetus to these exchanges, fostering the circulation of people, books, and ideas. Some of those ideas opposed the doctrines of the three Mediterranean monotheistic religions and had thus to be disseminated covertly to escape censorship. This talk will focus on a series of texts originated in the Iberian Peninsula in the 15th century that popularized a radical form of skepticism.",
                "url": "https://cesta.stanford.edu/events/david-sebastiani-plotting-unknown-reading-networks-early-modern-mediterranean",
                "year": "2023"
            },
            "value": 0
