                "date": "Tue February 28th 2023, 12:00 - 1:15pm",
                "location": "Wallenberg 433A",
                "description": "Shared sacred sites exist all over the world, but mostly enter public consciousness in times of conflict and contestation. In everyday life, such sites are often zones of conviviality or negotiated plural presence.",
                "url": "https://cesta.stanford.edu/events/anna-bigelow-storymapping-shared-sacred-sites-worksite-progress",
                "year": "2023"
