                "date": "Tue February 7th 2023, 12:00 - 1:15pm",
                "location": "Wallenberg 433A",
                "description": "We founded the \u0130stan\u03a0\u03cc\u03bb\u03b9\u03c2 Collaborative in 2020 to serve as an online hub for studies on the spatial/physical and demographic aspects of the Rum/Greek Orthodox presence in Istanbul between 1821 and 1923 and have been developing a range of Digital Humanities projects that link up to it. We will speak about how the Collaborative came to be, the scholarly questions we are addressing, the need for such a project both for scholarly and public domains, and the Digital Humanities methodologies we are developing to realize the project.",
