                "name": "Elaine A. Sullivan: Sacred Vision at Saqqara: Reimagining the sensorium of the dead at an ancient Egyptian necropolis in 3D | Center for Spatial and Textual Analysis",
                "date": "Tue April 30th 2024, 12:00 - 1:15pm",
                "location": "Wallenberg Hall, 433A, and Zoom",
                "description": "This workshop introduces one of the most effective forms of ritual communication and connection in ancient Egyptian culture which took place through human sight. Seeing was a reciprocal act, with the eye an active agent that reached out\u2014a concept likely stemming from the myth of the powerful \u2018divine eye\u2019. In looking upon the god (or the king in his divine form), a person interacted with him or her, benefited from their divine presence, and could even be healed by this vision, and thus prayers to \u2018see the god\u2019 were repeated in a variety of types of texts.",
