                "location": "Stanford Humanities Center Board Room and Zoom",
                "description": "This talk comes from James Hodge's book project, \"Ordinary Media: An Aesthetics of Always-On Computing.\" The premise of the project is that the smartphone has become for many the signature technology and engine of experience in the twenty-first century. One of the project's larger claims is that ambient givenness of smartphones in contemporary life has significantly reorganized the human sensorium and, moreover, has elevated the significance of experience at the level of the skin's surface, or what the psychoanalyst Thomas Ogden terms \"boundedness.\"\u00a0",
