                "location": "Online via Zoom.",
                "description": "This panel showcases careers beyond academia in fields which share an affinity with the digital humanities, including digital publishing, educational technology, and software development. Our panelists, whose roles span product management to program development to content production, all chose to pursue PhDs in the humanities and then to build their professional future in industry. We'll hear about their paths into their current positions,\u00a0the day-to-day of their current work, and what graduate students hoping to follow in their footsteps need to know. Our panelists:",
